// Song.js
import React from 'react';

const Song = () => {
  const title = "Song Title";
  const artist = "Artist Name";
  const year = 2022;

  return (
    <div>
      <h2>{title}</h2>
      <h3>{artist}</h3>
      <p>{year}</p>
    </div>
  );
};

export default Song;
